import styled from "styled-components";


const Btn = styled.button`
border: 2px solid green;
background-color: ${(props)=>props.variant=== 'outline' ? '#fff' : '#4caf50'};
color: ${(props)=>props.variant ==="outline" ? "#4caf50" : '#FFF'};
font-weight: bold;
`
export default Btn;
